    "2016-07-27T23:05:54.276391",nt"name": "initial-survey-instructions-for-columbian-white-tailed-deer-fawn-recruitment-index",nt"isopen":
    false,nt"url": null,nt"notes": "Fawn:doe ratio surveys have become an important
    metric for CWTD management, as fawn recruitment is critical factor affecting CWTD
    populations.  Fawn recruitment is affected by both fecundity and survival.  The
    fawn:doe ratio is an index to recruitment that is used to monitor population productivity.
     It is also used in conjunction with population estimates to determine whether
    predator management will occur on a year-to-year basis.  While adult survival is
    generally stable among years, fawn survival can fluctuate dramatically from year
    to year depending on predation and environmental conditions.  This ratio has ranged
    from 3u201360% on the JBH Mainland over the last 15 years and from 0u201350% on
    Tenasillahe Island.  Fawn:doe ratios of less than 37% initiates consideration of
    predator management as outlined in the CCP.Fall fawn:doe surveys have been conducted
    every year on 7 of the existing subpopulations since 1984.  Not only are they used
    to make decisions on predator control, the long-term dataset can be used to assess
    changes over time and correlate management actions or other biotic/abiotic factors.",nt"license_title":
